webpackJsonp([0x8d0713871235],{541:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Voracious Bookworm",author:"Lei"}},markdownRemark:{id:"/home/lei-lo/Code/voraciouscoder.github.io/src/pages/reading-roundup-11/index.md absPath of file >>> MarkdownRemark",html:"<p>I’m done the 2018 Read Harder Challenge! It took me 71 days, so a book almost every three days.\nThat means I finished two months earlier than last year, and I am free to go on to the next challenge!</p>\n<p><strong>The Lover</strong><br>\n<em>Read Harder Challenge: A book of genre fiction in translation (romance)</em></p>\n<p>This book reminded me of <em>That Summer in Provincetown</em>\n(which is fitting, because that was the first read of the Read Harder Challenge, and this is my last read of it!!!)\nin the vignette-style, the re-telling of the same events in different ways, and the setting in Southeast Asia.\nI thought this one was less successful though. Perhaps because this one is fancier (it won the <em>Prix Goncourt</em>).\nOr maybe because it went over my head? It could just be literature that I am unequipped to examine. The story is sad but not surprising.\nI completely understand why the content was controversial. Maybe that’s why people read it. Y’all can find out for yourselves. :)</p>",frontmatter:{title:"Reading Roundup 11",date:"March 13, 2018"}}},pathContext:{slug:"/reading-roundup-11/",previous:{fields:{slug:"/reading-roundup-10/"},frontmatter:{title:"Reading Roundup 10"}},next:{fields:{slug:"/hello-world/"},frontmatter:{title:"Hello World!"}}}}}});
